import logo from "./logo.svg";
import "./App.css";
import StringDisplay from "./StringDisplay";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <StringDisplay string="This is in app" />
      </header>
    </div>
  );
}

export default App;
